import React, { Component } from 'react'

export default class Form extends Component {
    
    constructor(props){
        super(props);
        this.state={
            input:'test',
            input2:'test2'
        }
        
        this.handleChange=this.handleChange.bind(this)

    }
    handleChange(e){
       const newInput=e.target.value;
        
        this.setState({input:newInput})
    }
    handleChange2=(e)=>{
      const input1 = e.target.value
      console.log(input1);
    }
    render() {
        return (
            <div>
               <form onSubmit={(e)=>{e.preventDefault()}} >
               <input onChange={this.handleChange} value={this.state.input} type="text" placeholder="input" />
               <input onChange={this.handleChange2} value={this.state.input2} type="text" placeholder="input" />
                <button type="submit" >ok</button>
               </form>
            </div>
        )
    }
}
